ty(node.data, \'stroke\', \'white\' );\\n                                    }\\n                                    else {\\n                                        $this.canvas.model.setDataProperty(node.data, \'stroke\', \'black\' );\\n                                    }\\n\\n                                    $this.canvas.model.setDataProperty(node.data, \'text\', \'Tanque \' +  percent + \'%\' );\\n                                    $this.canvas.model.setDataProperty(node.data, \'fill\', fill);\\n\\n                                });\\n\\n\\n                                $this.CommitTrans(TransName , $this);\\n\\n\\n\\n\\n                            } , 2000);\\n\\n                        }\", \"alias\":\"Funcion\", \"control\":\"input-code\", \"system\":false} ], \"key\":-1, \"loc\":\"420 460\"},\n{\"name\":\"Photon\", \"keys\":\"_photon\", \"value\":null, \"src\":\"Photon\", \"sid\":\"iq_7753724663\", \"category\":\"SCADA_B\", \"figure\":\"_particle\", \"text\":\"Photon\", \"properties\":[ {\"name\":\"variable\", \"alias\":\"Variables\", \"value\":null, \"func\":null, \"control\":\"\", \"system\":true},{\"name\":\"active\", \"alias\":\"Activo\", \"value\":false, \"func\":null, \"control\":\"\", \"system\":true},{\"name\":\"styles\", \"value\":[], \"func\":null, \"control\":\"select\", \"system\":false},{\"name\":\"graph\", \"value\":{\"type\":\"linear\", \"data\":{}}, \"func\":null, \"control\":\"graph\", \"system\":false},{\"name\":\"personalize\", \"value\":{\"photonID\":\"\"}, \"func\":null, \"control\":\"input\", \"system\":false},{\"name\":\"restrict\", \"alias\":\"Restricciones\", \"value\":[ \"_tank\",\"_flowsensor\",\"_manometer\" ], \"control\":\"input\", \"system\":false},{\"name\":\"description\", \"alias\":\"Descripcion\", \"value\":\"...\", \"control\":\"\", \"system\":true},{\"name\":\"function\", \"backup\":\"function (){}\", \"alias\":\"Funcion\", \"control\":\"input-code\", \"system\":false} ], \"key\":-4, \"loc\":\"310 190\"},\n{\"name\":\"Cloud\", \"keys\":\"_photon_cloud\", \"value\":null, \"src\":\"cloud-2\", \"sid\":\"iq_5312452838\", \"category\":\"SCADA_B\", \"figure\":\"_particle_cloud\", \"text\":\"Cloud\", \"properties\":[ {\"name\":\"variable\", \"alias\":\"Variables\", \"value\":null, \"func\":null, \"control\":\"\", \"system\":true},{\"name\":\"active\", \"alias\":\"Activo\", \"value\":false, \"func\":null, \"control\":\"\", \"system\":true},{\"name\":\"styles\", \"value\":[], \"func\":null, \"control\":\"select\", \"system\":false},{\"name\":\"graph\", \"value\":{\"type\":\"linear\", \"data\":{}}, \"func\":null, \"control\":\"graph\", \"system\":false},{\"name\":\"personalize\", \"value\":{\"particleId\":\"\"}, \"func\":null, \"control\":\"input\", \"system\":false},{\"name\":\"restrict\", \"alias\":\"Restricciones\", \"value\":[ \"_tank\",\"_flowsensor\",\"_manometer\" ], \"control\":\"input\", \"system\":false},{\"name\":\"description\", \"alias\":\"Descripcion\", \"value\":\"...\", \"control\":\"\", \"system\":true},{\"name\":\"function\", \"backup\":\"function (){\\n\\n                            var $this = scada;\\n\\n\\n                            var verify = function(){\\n\\n                                $this.canvas.startTransaction();\\n\\n                                $this.canvas.nodes.each(function(node) {\\n\\n                                    if(node.part.data.keys  !== \'_photon_cloud\') return ;\\n                                    $this.canvas.model.setDataProperty(node.data, \'src\', \'cloud-2\' );\\n                                });\\n\\n                                $this.canvas.commitTransaction(\'Iniciando modificacion ...\');\\n\\n                            };\\n\\n                            setTimeout(verify , 5000);\\n\\n\\n                        }\", \"alias\":\"Funcion\", \"control\":\"input-code\", \"system\":false} ], \"key\":-5, \"loc\":\"700 150\"},\n{\"text\":\"Flujometro\", \"value\":56, \"category\":\"SCADA_GAUGE_1\", \"figure\":\"flow_sensor\", \"keys\":\"_flowsensor\", \"name\":\"Gauge\", \"sid\":\"iq_7902896184\", \"width\":100, \"height\":100, \"properties\":[ {\"name\":\"variable\", \"alias\":\"Variables\", \"value\":\"7\", \"func\":null, \"control\":\"\", \"system\":true},{\"name\":\"active\", \"alias\":\"Activo\", \"value\":true, \"func\":null, \"control\":\"\", \"system\":true},{\"name\":\"styles\", \"value\":\"undefined\", \"func\":null, \"control\":\"select\", \"system\":false},{\"name\":\"graph\", \"value\":{\"type\":\"linear\", \"data\":{}}, \"func\":null, \"control\":\"graph\", \"system\":false},{\"name\":\"personalize\", \"alias\":\"Control\", \"value\":{\"max\":0, \"min\":0, \"type\":\"flujometer\"}, \"func\":null, \"control\":\"input\", \"system\":false},{\"name\":\"restrict\", \"alias\":\"Restricciones\", \"value\":\"_manometer,_flowsensor\", \"control\":\"input\", \"system\":true},{\"name\":\"description\", \"alias\":\"Descripcion\", \"value\":\"...\", \"control\":\"\", \"system\":true},{\"name\":\"function\", \"backup\":\"function (){\\n\\n                            /**\\n                             * En las cadenas favor no utilizar comillas dobles\\n                             * ya que si se utilizan se remplazaran por comillas simples\\n                             * **/\\n\\n                            /**\\n                             *  este algoritmo es un ejemplo de como se podria llenar el\\n                             tanque a base de calculos matematicos basicos\\n                             */\\n\\n\\n                            var $this = scada;\\n                            var TransName = \'MyFlow\' + String(Math.random());\\n\\n\\n                            setInterval(function() {\\n\\n\\n                                //Funcion scada para transferir informacion al canvas\\n                                $this.StartTrans(TransName , $this );\\n\\n                                //analizamos los nodos\\n                                $this.canvas.nodes.each(function(node) {\\n\\n\\n                                    //verificamos que el noso a generar sea sensor de flujo\\n                                    if(node.part.data.keys  !== \'_flowsensor\') return ;\\n\\n\\n                                    //buscamos el objeto de escala en cual generara\\n                                    var scale = node.findObject(\'SCALE\');\\n\\n\\n                                    //si la escala es nulla detener todo\\n                                    if (scale === null || scale.type !== go.Panel.Graduated) return;\\n\\n                                    //generamos el min y el max\\n                                    var min = scale.graduatedMin;\\n                                    var max = scale.graduatedMax;\\n\\n                                    //creamos un valor basados en min y max\\n                                    var v = node.data.value || Math.floor((max - min) / 2);\\n\\n                                    //condicionales\\n                                    if (v < min) v++;\\n                                    else if (v > max) v--;\\n                                    else v += (Math.random() < 0.5) ? -0.5 : 0.5;\\n\\n                                    //enviamos el valor\\n                                    $this.canvas.model.setDataProperty(node.data, \'value\', v);\\n\\n                                });\\n\\n                                //enviar commit a los datos actualizados\\n                                $this.CommitTrans(TransName , $this);\\n                            }, 5000/6);\\n\\n\\n                        }\", \"alias\":\"Funcion\", \"control\":\"input-code\", \"system\":false} ], \"key\":-2}\n ],\n  \"linkDataArray\": [ \n{\"keys\":\"_cloudline\", \"points\":[ 400,190,410,190,505,190,505,150,600,150,610,150 ], \"stroke3\":\"yellow\", \"name3\":\"_connline\", \"type\":\"line\", \"width3\":13, \"stroke4\":\"black\", \"width4\":5, \"active\":true, \"rollback\":false